  input: '"TEXT","F3XA","C00003111","The payments for sakaries and wages listed as
    not FEA are for employees who did not spend more than 25% of their time on Federal
    Election Activity.  None of the expenditures for direct mail, fundraising, portage
    and telemarketing included on Schedule B supporting line 21(b) were on behalf
    of a clearly identified candidate for federal office and do not promote, support,
    attack or oppose any candidate for federal office that references Schedule A.  This
    Amendment is being filed to clarify or correct errors in the original filing as
    requested by FEC letter dated October 3, 2007.  Item 1, amendments should have
    been filed to correct the beginning cash balance.  This amendment will correct
    that.  Item 2, negative balances for Nicholson and Augusta Fuel were the result
    of posting errors (purely clerical) and have been corrected.  Item 3, the negative
    debt for City of Augusta is the result of the wrong amount being posted to the
    accounts payable on the December 2006 final report.  This adjustment was entered
    to reflect the correct amount owed to the City.  Items 4 and 5 reflect the incorrect
    fixed percentage of the allocated federal and nonfederal ratios.  This was entered
    incorrectly in error (clerical) but is now corrected.  Item 6, references to Direct
    Mail 2004 were posting errors and have been corrected.  Item 7 reference to Event
    Expense were posting errors, one was for design work on a mailer and the other
    reference to event expense was actually floral arrangements sent for funerals."'
